          <Route path="/" >
            <Join />
          </Route>

          <Route path="/chat" >
            <Chat />
          </Route>

          <Route path="/socketuser">
            <SocketUser />
          </Route>
*/


class App extends Component{
  constructor(props){
    super(props);

    // const socket = this.socket;
    // console.log("LOOK HERE: " + socket);
    socket.emit('FINALLY', {msg: "FINALLY OMG PLEASE"});

  }

  blah(){
    socket.emit('FINALLY', {msg: "FINALLY OMG PLEASE"});
  }


  render(){
    return(
      <Router>
        <Switch>

        <Route path="/" exact component={Join} />
        <Route path="/chat" exact component={Chat} />
        <Route path="/socketuser" exact component={SocketUser} />

        </Switch>
    </Router>
    )
  }

}



export default App;
